import logo from '.assets/logo.png'

export default class Header extends Component {
  render() {
    return (
        <div>
            <div className='w-full h-20 font-bold text-6xl bg-purple-900 text-white top-0 shadow-md fixed flex justify-center text-center shadow-neutral-900'>
                <div>Header</div>
                <img src={logo} alt=""/>
            </div>
        </div>
      
     
    )
  }
}
